  height: 65vh;
  background: url("./images/home/sec-2.jpg") no-repeat;
  background-size: cover;
  background-attachment: fixed;
  display: flex;
  align-items: center;
`

const Col = styled.div`
  display: flex;
  flex-direction: column;
  
`

const mockData = [
    {
        img: '/images/icons/service_icon_01.png',
        title: 'กระบี่ มาทำไม?',
        paragraph: ''
    }
]

const Section2 = () => {

    return (
        <>
            <AboutKrabi>
                <Container maxWidth={"md"} className={'flex justify-around items-center h-3/4 '}>

                </Container>
            </AboutKrabi>
        </>
    );
}

export default Section2;
